import React from 'react'

const Navbar = () => {
    return (
        <div className="bg-gray-800">
            <div className='h-16 flex items-center  px-8'>
                <p className='text-white font-bold'>RULoans</p>
            </div>
        </div>
    )
}

export default Navbar
